import React from "react";

export default function Login() {
  return (
    <div>
      <form onSubmit={null}>
        <h1>email</h1>
        <input type="email" name="email" placeholder="email" />
        <h1>password</h1>
        <input type="password" name="password" placeholder="password" />
        <button type="submit">Login</button>
      </form>
    </div>
  );
}
